import "./App.css";

function App() {
  const paymentCall = () => {
    fetch("http://localhost:4000/payment", {
      headers: {
        "Content-type": "application/json",
      },
      method: "POST",
      body: JSON.stringify({
        userName: "Aniket",
        userId: "123456",
        userEmail: "abns@jhafg",
        userPaymentMethod: "Card",
      }),
    })
      .then((res) => {
        return res.json();
      })
      .then((res) => console.log(res))
      .catch((error) => {
        console.log(error);
      });
  };
  return (
    <div className="container">
      <h1>Payment</h1>
      <div className="first-row">
        <div className="owner">
          <h3>Owner</h3>
          <div className="input-field">
            <input type="text"></input>
          </div>
        </div>
        <div className="cvv">
          <h3>CVV</h3>
          <div className="input-field">
            <input type="password"></input>
          </div>
        </div>
      </div>
      <div className="second-row">
        <div className="card-number">
          <h3>Card Number</h3>
          <div className="input-field">
            <input type="text"></input>
          </div>
        </div>
      </div>
      <div className="third-row">
        <h3>Card Number</h3>
        <div className="selection">
          <div className="date">
            <select name="months" id="months"></select>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
